import React, { useState } from 'react';
import FormationsWindow from '../../AppleWindow/Formations/index';
import '../index.css';
import FolderIcon from './icons/folder.p'

const folder = [{ id: 2, name: 'formations', img: './icons/folder.png' }];

function Formations() {
  const [toggle, setToggle] = useState();

  const showWindow = () => {
    setToggle(!toggle);
  };

  return (
    <div className="folder">
      <div className="folder-content">
        <div className="folder-icon">
          <img className="i-folder" src={folder.img} alt="folder" />
        </div>
        <div className="folder-name"></div>
      </div>
    </div>
  );
}

export default Formations;
